// DataList.js
import React from "react";

const DataList = ({ data, onUpdateData, onDeleteData }) => {
    return (
        <div>
            {data.map((item) => (
                <div key={item.id}>
                    <span>{item.name}</span>
                    <button onClick={() => onUpdateData(item)}>수정</button>
                    <button onClick={() => onDeleteData(item.id)}>삭제</button>
                </div>
            ))}
        </div>
    );
};

export default DataList;
